INSERT INTO `stories` (`id`, `created_at`, `updated_at`, `franchisee_id`, `image`, `title`, `description`) VALUES
(1, '2021-10-30 09:46:18', '2021-10-30 09:46:18', '00510835', 'uploads/stories/first business.jpeg', 'My first Journey here in this business.', 'July 2020, we started to sell our first fresh siomai and siopao from JC Worldwide franchise. We never thought that our business will grow each in every day and so does our profit at the same time.'),
(2, '2021-10-30 09:49:38', '2021-10-30 09:49:38', '00510835', 'uploads/stories/IMG_0288.jpg', 'My achievement for selling our goods', 'Since our business grows every day, we also upgrade our storage for our food due to the high demand selling. We knew this is only the beginning of our Journey.'),
(3, '2021-10-30 09:52:58', '2021-10-30 09:52:58', '00510835', 'uploads/stories/first franchisee.jpeg', 'Our first franchisee who believe in our business.', 'We already expected that something would happen like this. We knew that this pandemic will be a great challenge to all of us. That\'s why some of our customers really interested in our franchise and they join us as a business partner.'),
(4, '2021-10-30 09:56:50', '2021-10-30 09:56:50', '00510835', 'uploads/stories/ken enda.jpeg', 'Our first visit in our Office!', 'This is one of my favorite and memorable events of my life. Who would have thought that we would meet one of the top franchisees of our company?'),
(5, '2021-10-30 10:02:21', '2021-10-30 10:02:21', '00510835', 'uploads/stories/first top performer.jpeg', 'Top Franchisee', 'YES!! WE ARE ALL IN A SHOCK MOMENT WHEN THE COMPANY SAID WE ARE ONE OF THE TOP PERFORMERS/FRANCHISEES OF THE COMPANY.'),
(6, '2021-10-30 10:05:30', '2021-10-30 10:05:30', '00510835', 'uploads/stories/rise of youth.jpeg', 'The beginning of The Champions', 'the first group of youth in Team, at this moment we celebrate our wins together.'),
(7, '2021-10-30 10:07:42', '2021-10-30 10:07:42', '00510835', 'uploads/stories/encash.jpeg', 'Cheque Release!', 'Getting our cheque and earnings in doing this business with my group of franchisees.'),
(8, '2021-10-30 10:11:43', '2021-10-30 10:11:43', '00510835', 'uploads/stories/my toktok house.jpeg', 'love your business and your business will love you', 'I know most people wouldn\'t care about my business, but why not? let\'s try because nothing will lose in the end. \"Let the people know your business and then let the people do the job for you\".'),
(9, '2021-10-30 10:15:43', '2021-10-30 10:15:43', '00510835', 'uploads/stories/Screen Shot 2021-10-31 at 12.14.50 AM.png', 'My first Million in doing this business!', 'Be consistent, be patient, and lastly love what you are doing.'),
(10, '2021-10-30 10:18:27', '2021-10-30 10:18:27', '00510835', 'uploads/stories/IMG_0235.JPG', 'An exclusive meeting with CFO of our company.', 'There are thousands of franchisees in the world, yet 15 of us were chosen for this opportunity.'),
(11, '2021-10-30 10:20:54', '2021-10-30 10:20:54', '00510835', 'uploads/stories/tempImagej7f26z.jpg', 'CAUSE WE\'RE THE CHAMPIONS', 'ONE OF THE GREATEST EXPERIENCES WE EVER HAD.'),
(13, '2021-10-30 21:13:06', '2021-10-30 21:13:06', '1111499730', 'uploads/stories/248440955_562787308129259_5940333140833514938_n.jpg', 'My first week income', 'Di ko naisip na iincome ako ng ganitong kabilis, sipag at tyaga lng! \r\nMay kasabihan nga tyo,\r\n\"Nasa dyos ang awa nasa tao ang GAWA\"'),
(31, '2021-10-31 01:40:13', '2021-10-31 01:40:13', '1111554855', 'uploads/stories/L.PNG', 'My first journey here in this business. ', 'My first journey here in this business. '),
(33, '2021-10-31 01:44:39', '2021-10-31 01:44:39', '1111554855', 'uploads/stories/244881095_4729112167119272_7362525807361996328_n.jpg', 'Become one of the PASM\'s Top Performers ', 'Become one of the PASM\'s Top Performers '),
(35, '2021-10-31 01:48:45', '2021-10-31 01:48:45', '1111889903', 'uploads/stories/191430615_4694897207203779_6335319726082548514_n.jpg', 'FIRST VISIT HEAD OFFICE ', 'Ito ang first visit ko sa JC Premiere '),
(37, '2021-10-31 01:54:09', '2021-10-31 01:54:09', '1111889903', 'uploads/stories/first benta.jpg', 'K- pads', 'Ito ang first sale ko ng K-Pads'),
(38, '2021-10-31 02:11:33', '2021-10-31 02:11:33', '1111889903', 'uploads/stories/trainings2.png', 'Trainings', 'Ang saya maging part ng Team na ito, daming learnings sa trainings.'),
(39, '2021-10-31 02:13:57', '2021-10-31 02:13:57', '1111889903', 'uploads/stories/240724119_5002321096461387_4741650798279295302_n.jpg', 'My first Check', 'Ito yun first claim ko ng aking check.Ang saya.'),
(40, '2021-10-31 03:40:50', '2021-10-31 03:40:50', 'PPS4748939', 'uploads/stories/analog.png', 'My employee career', 'Having passed the Electronics Engineering board exams last October 2017, I was able to land a job at one of the most prestigious semiconductor manufacturing companies in the whole world, Analog Devices, Inc. This is my first job and is currently employed for more than 3.5 years since February 2018.'),
(41, '2021-10-31 03:51:28', '2021-10-31 03:51:28', 'PPS4748939', 'uploads/stories/toktok franchise.jpg', 'How I started in this business', 'It was last September 2021 when one of my friends introduced toktok to me. At first, it was of a request to download toktok into my phone and 1 week after, he invited me to the webinar. I never hesitated to franchise since at that moment, I already know that this will give me my financial freedom.'),
(42, '2021-10-31 04:34:47', '2021-10-31 04:34:47', 'PPS4748939', 'uploads/stories/start.png', 'My first journey in this business', 'Since I\'m a full-time employee, doing this business part-time is a big challenge for me since I have to adjust my time and set priorities. However, my job didn\'t stop me from doing this business by attending trainings everyday, meeting with my team leaders and sharing the opportunity to many people.'),
(43, '2021-10-31 05:01:32', '2021-10-31 05:01:32', 'PPS4748939', 'uploads/stories/teambuild.png', 'Team Building - Batch 4', 'It was at this event that made me affirm why I did this business in the first place. This event also made me realize that I can achieve all the things I want to have in my lifetime as long as I believe in myself and believe in the people who supports me in my business journey.'),
(44, '2021-10-31 05:15:48', '2021-10-31 05:15:48', 'PPS4748939', 'uploads/stories/1st income.jpg', 'My first income in doing this business', 'I have made this much money while doing this business part-time. Just imagine how much more would I make if I do this business full-time.'),
