(53, '2021-10-31 09:11:59', '2021-10-31 09:11:59', '1111581395', 'uploads/stories/248943386_372687837966186_3004989308435251336_n.jpg', 'My life before a franchisee', 'Before I became a Toktok franchisee, I was just a 2nd year student of BS in Accountancy in University of Nueva Caceres and the Vice President for Non Academics of Junior Philippine Institute of Accountants and also the Vice President of Association of Accountancy and Business Management.  '),
