(137, '2021-11-03 19:23:43', '2021-11-03 19:23:43', '1111464379', 'uploads/stories/251978918_1057128505099489_318153691534276383_n.jpg', 'My Family', 'The most precious gift to us by our Lord is our family. The family will never stop loving and supporting you in every endeavor, journey, trial, and'),
(138, '2021-11-03 22:35:34', '2021-11-03 22:35:34', '00493780', 'uploads/stories/9D161EC7-B304-4F19-8D85-F25DAFC5E005.jpeg', 'MEET & GREET WITH THE COMPANY OWNERS', 'Yes! Meeting with the Company Owners. Such a great opportunity, saan ka nakakakita company owners minimeet franchisees nila. '),
(139, '2021-11-04 08:38:10', '2021-11-04 08:38:10', '1111464379', 'uploads/stories/252088365_2917589268493665_6674567801643660085_n.jpg', 'My Professional Career', 'Truly blessed to be part of AG. 20yrs and counting...Thank you, Lord. To God be the Glory!'),
(140, '2021-11-04 18:24:40', '2021-11-04 18:24:40', 'PPS7018421', 'uploads/stories/received_442619160273090.jpeg', 'My freebies... ', 'Omniwhite soap\r\nKPads\r\nSiomai\r\nMang Bok\'s manok'),
(141, '2021-11-04 18:53:57', '2021-11-04 18:53:57', 'PPS7018421', 'uploads/stories/IMG_20210826_123616.jpg', 'First visit at store (San Juan) and buy Products', '... '),
(142, '2021-11-05 03:26:06', '2021-11-05 03:26:06', '1111554855', 'uploads/stories/240409996_2827345407576271_2198893487747533849_n.jpg', 'Using my own Delivery Service ', 'I use Toktok to deliver our plants, and every time I book a delivery, I earn a 3 percent commission. That is why I enjoy my business; I can earn money from my plants as well as from my deliveries.'),
(143, '2021-11-05 04:13:38', '2021-11-05 04:13:38', '00567903', 'uploads/stories/received_1017038132205412.jpeg', 'PARA SA PANGARAP - WALANG RASON', 'Continous learning and mentoring for everyone\'s success. Proud to be part of the team #Teamwork'),
(144, '2021-11-05 04:16:35', '2021-11-05 04:16:35', '00567903', 'uploads/stories/FB_IMG_1636107323895.jpg', 'TOKTOK EDSA BILLBOARD/PARADE', 'NEW BILLBOARD @ Edsa Guadalupe????????????'),
(145, '2021-11-05 04:20:05', '2021-11-05 04:20:05', '00567903', 'uploads/stories/IMG_20210812_202543.jpg', 'Health & Wellness Product', 'Discounted Branded Health & Wellness Jc Products that gives us additional income/can be personal use.'),
(146, '2021-11-05 04:22:08', '2021-11-05 04:22:08', '00567903', 'uploads/stories/FB_IMG_1636107649671.jpg', 'FOOD BUSINESS', 'Inclusion as a franchisee we are able to earn in multiple ways by distributing branded food products.'),
(147, '2021-11-05 05:44:20', '2021-11-05 05:44:20', '1111517953', 'uploads/stories/FB_IMG_1600133625718.jpg', 'Carrier as employee', 'Process Engineering Team'),
(148, '2021-11-05 06:00:46', '2021-11-05 06:00:46', '1111517953', 'uploads/stories/toktok agent.jpg', 'Client who trusted us as an Agent', 'Real State Salesperson'),
(149, '2021-11-05 06:05:55', '2021-11-05 06:05:55', '1111517953', 'uploads/stories/New Toktok member.jpg', 'New Business Acquisitions', 'These young entreprenuer\'s will help you fulfill our dreams, an endless knowledge you\'ll learn each in everyday. The only online businness with so many ways to earn'),
(150, '2021-11-06 21:13:57', '2021-11-06 21:13:57', 'PPS13119348', 'uploads/stories/received_1500579000308237.jpeg', 'With My Mentors', 'They Discuss everything and step by step'),
(151, '2021-11-06 21:15:20', '2021-11-06 21:15:20', 'PPS13119348', 'uploads/stories/received_1017935902294841.jpeg', 'My First and Best Team Building ', 'MY FIRST AND ONE OF THE GREATEST EXPERIENCE THAT I EVER HAD'),
(152, '2021-11-07 06:26:19', '2021-11-07 06:26:19', 'PPS10104258', 'uploads/stories/PhotoGrid_1636291458152.jpg', 'Welcome to the GOOD LIFE! ', 'May 2021, I took the risk and joined in this business as I see greater opportunities without me even knowing that this risk would change me -- my mindset, my lifestyle, my perspective. This business helped me become a better version of myself.\r\nTAKE RISK.\r\n\"The biggest risk is not taking any risk\"'),
(153, '2021-11-07 06:48:01', '2021-11-07 06:48:01', 'PPS10104258', 'uploads/stories/IMG_20211106_155442.jpg', 'My first income! ', '\"You don\'t need to be great to start, but you have to start to be great!\"\r\nAt this moment I know I\'m still a work in progress but I\'m so glad I decided to start working on this business.'),
(154, '2021-11-07 07:37:11', '2021-11-07 07:37:11', 'PPS10104258', 'uploads/stories/PhotoGrid_1636295434952.jpg', 'THE CHAMPIONS - OLYMPIANS ', 'The best thing in this business is that, you\'ll never walk alone. Your journey is not just a journey with yourself but a journey with a team. A team that lifts each other up and will push you to go beyond your limits. My very solid support system!! '),
(155, '2021-11-07 08:08:33', '2021-11-07 08:08:33', 'PPS10104258', 'uploads/stories/PhotoGrid_1636297165958.jpg', 'Top Performers ', 'The company that values you, recognizes you! Giving this kind of recognition helps me to strive harder, to do better and aim higher. '),
(156, '2021-11-08 23:42:47', '2021-11-08 23:42:47', 'PPS10205131', 'uploads/stories/253948014_2985394191701200_3994558915398199284_n.jpg', 'First package received from the Philippines ', 'It\'s true that before selling your products, you must be the product of your own products. I can say that our products are internationally acclaimed and patronized by our own fellow Filipinos here and abroad.'),
(157, '2021-11-09 00:05:46', '2021-11-09 00:05:46', 'PPS10205131', 'uploads/stories/Untitled.png', 'Helping others in a simple way.', 'During pandemic, July 2020 when I started the business. A lot of people lost their jobs, lost their source of income. Through this online franchising business, I was able to help most of my family members to have their own business as well. They were able to earned more for their daily living.'),
(158, '2021-11-09 00:30:06', '2021-11-09 00:30:06', 'PPS10205131', 'uploads/stories/2.png', 'Mentoring & Continuous Training', 'In this team The Champions, mentoring and trainings are conducted by our mentors & coaches FREE of charge. No other team can offer the dedication & commitment. Teamwork done!'),
(159, '2021-11-09 01:07:05', '2021-11-09 01:07:05', 'PPS10205131', 'uploads/stories/3.png', 'Top Performer', 'Nothing compares of the feelings to be on the list of the Top Performers of the company. Consistency needs to consider & success will follow in every step you make. \r\nTagumpay!'),
(160, '2021-11-09 01:18:05', '2021-11-09 01:18:05', 'PPS10205131', 'uploads/stories/2021-09-25 (19).png', 'Incentive Qualifier', 'Last September 2021, I claimed the incentive from the company. It\'s overwhelming and so worthy. Sacrifices paid off!'),
(161, '2021-11-09 23:39:54', '2021-11-09 23:39:54', '1111554855', 'uploads/stories/Bunga ng pag sipag at tyaga at araw araw na training.png', 'My 2 Months Income ', 'Because it\'s only my part-time job, this income is already substantial especially for me as a young entrepreneur. '),
(162, '2021-11-14 21:10:23', '2021-11-14 21:10:23', '1111592229', 'uploads/stories/received_2054042024738345.jpeg', 'The start of my Toktok Journey', 'April 3, 2021 when I first found out this business that turn almost whole of my mindset from fixed to growth mindset'),
(163, '2021-11-14 21:13:31', '2021-11-14 21:13:31', '1111592229', 'uploads/stories/Screenshot (613).png', 'Every Night Zoom Trainings', 'In this business, we have a solid support system that enables you not to know only the business itself, but knowing also how these faces might help you to grow more in this field.'),
(164, '2021-11-14 21:20:31', '2021-11-14 21:20:31', '1111592229', 'uploads/stories/received_148425737265008.jpeg', 'That training pays off!', 'After a month of training, with my dedication, willingness to learn, and learning to love this business, I had gained this income in just 1 week!'),
(165, '2021-11-14 21:23:46', '2021-11-14 21:23:46', '1111592229', 'uploads/stories/182983796_203955644702444_4078074651289926700_n.jpg', 'The first meetup', 'I was able to meet our powerful coaches named \"Lilian and Joaquin\" last May 10. '),
(166, '2021-11-14 21:28:28', '2021-11-14 21:28:28', '1111592229', 'uploads/stories/185542702_903212326922955_2376127876809134307_n.jpg', 'A very memorable Day', 'Why I entitled this as the \"memorable\"? It is because I was able to owned my first Coppermask and I had the opportunity to visit our JC office in ortigas. '),
(167, '2021-11-14 21:30:41', '2021-11-14 21:30:41', '1111592229', 'uploads/stories/received_338792637650747.jpeg', 'Income in just 2 weeks!', 'Yes! you red it right, this is my income for 2 weeks in doing this business. Imagine, I do not engaged myself in the outside. It is pure online-based business!'),
(168, '2021-11-14 21:31:41', '2021-11-14 21:31:41', '1112050895', 'uploads/stories/IMG_20211115_122202.jpg', 'ME AS A NURSE.', 'Wayback 2017, I started working in a hospital as a Staff Nurse. They trained me for about 2 weeks until I\'ve independently handled patients.\r\nBeing in there wasn\'t really easy at all. Actually, No job is easy. You need to work hard for it whatever job it is.\r\n'),
(169, '2021-11-14 21:38:57', '2021-11-14 21:38:57', '1111592229', 'uploads/stories/186564214_332045264951400_7998573510580395708_n.jpg', 'Our Franchisee who believe in our business.', 'Yes, I found out the first person who believed in me, and she is my TIta.'),
(170, '2021-11-14 21:40:14', '2021-11-14 21:40:14', '1111592229', 'uploads/stories/Screenshot (596).png', 'Training continues!', 'Yes, continues trainings means continues growing.'),
(171, '2021-11-14 21:43:14', '2021-11-14 21:43:14', '1111592229', 'uploads/stories/20210911160740_IMG_3882.JPG', 'My first Cheque', 'Yes, a proof that our business is legit! I had the opportunity to own my first cheque in doing this business.'),
(172, '2021-11-14 21:48:41', '2021-11-14 21:48:41', '1111592229', 'uploads/stories/255678076_430338258808352_5718685526612476902_n.jpg', 'Top Franchisee', 'I was able to hit my first award of being a Top franchisee of our team!'),
(173, '2021-11-14 21:54:25', '2021-11-14 21:54:25', '1111592229', 'uploads/stories/256832059_430670448457467_8614794343543738733_n.jpg', 'The Champions ', 'One of the greatest experienced we ever had.'),
(174, '2021-11-14 21:56:09', '2021-11-14 21:56:09', '1111592229', 'uploads/stories/255247559_441797304027253_238788988696864751_n.jpg', 'Hitting the TOP PERFORMERS again!', 'Yes, I had the opportunity of being a Top Performer again on our team. And I believe, that I will hit my first Top performer on our company.'),
(175, '2021-11-14 21:58:52', '2021-11-14 21:58:52', '1111592229', 'uploads/stories/256059272_428658632029058_5638404189229336853_n.jpg', 'The unexpected Meetup', 'Yes, this is so unexpected, aside of my MC transaction, I had the opportunity to met one of our company\'s powerful mentor Mr. Kenichi Enda (Next to Doc Roger with a green polo shirt).'),
(176, '2021-11-14 22:01:20', '2021-11-14 22:01:20', '1111592229', 'uploads/stories/255734574_4567013350028024_7083016689964194954_n.jpg', 'Transactions!!', 'As your coach, I promise to do my task of being a leader to you. I was able to experience this kind of business opportunity, and I want you to experienced it too!'),
(177, '2021-11-14 22:26:53', '2021-11-14 22:26:53', '1112050895', 'uploads/stories/IMG_20211115_121230.jpg', 'What it takes to being a nurse.', 'There are times that you can\'t even have a snack or take time pee until the end of your shift because you\'re loaded with tasks. You need to work double shifts when your co-nurse is not available. You won\'t be with your family at all times, especially during holidays or important events. '),
(178, '2021-11-14 22:31:30', '2021-11-14 22:31:30', '1112050895', 'uploads/stories/IMG_20211115_114705.jpg', 'What it takes to being a nurse.', 'You can focus on taking care of other people but not with your family. You\'re a waterproof because you still need to go to work as much as possible, no matter what it takes. Sometimes, people won\'t treat you right and won\'t appreciate your efforts, because they\'ll just say \"You\'re being Paid\".'),
(179, '2021-11-14 22:38:23', '2021-11-14 22:38:23', '1112050895', 'uploads/stories/IMG_20211115_133110.jpg', 'What it takes to being a nurse.', 'Though, you\'re unwell, you still try your best to go to work just to be of service to others. \r\n\r\nThere are a lot more to talk about but the saddest thing is that, your salary doesn\'t suffice all the sacrifices you are giving.'),
(180, '2021-11-14 22:47:40', '2021-11-14 22:47:40', '1112050895', 'uploads/stories/IMG_20211115_133737.jpg', 'My Loving Grandma got sick and PANDEMIC strikes.', 'January 2019, my Grandmother got sick. I\'ve filed almost everything, sick leave, emergency leave, and indefinite leave.. Until I have no choice but to resign from my job so that I can focus on my grandmother. I was with her althrough out. Then Pandemic entered our country. '),
(181, '2021-11-14 23:17:08', '2021-11-14 23:17:08', '1112050895', 'uploads/stories/IMG_20211115_140137.jpg', 'PANDEMIC strikes.', 'We all know how the pandemic affected our lives, our economy.\r\n\r\nIt wasn\'t easy to enter the hospital & get admitted. A lot of things & examinations were added to our bills. \r\n\r\nThen I told myself,\"Though grandma is giving me allowance bacause of being her private nurse. \r\nI said,I want to help her more\"'),
(182, '2021-11-14 23:29:56', '2021-11-14 23:29:56', '1112050895', 'uploads/stories/received_1039451159963420.jpeg', 'Being an ONLINE SELLER.', 'May 2021, I decided to be a reseller of SbyMissFlawless (Skin care products).\r\n\r\nLater on, I\'ve upgraded to being a City Distributor..\r\n\r\nI really saw the beauty in online business. You can really earn wherever and whenever you are.'),
(183, '2021-11-14 23:39:04', '2021-11-14 23:39:04', '1112050895', 'uploads/stories/received_4412608528788136.gif', 'Being a TOKTOK ONLINE FRANCHISEE.', 'October 2021, I finally became a franchisee. I saw how great the opportunities are in here. I started attending webinars months ago when it was introduced to me, and I am really happy to be part of this because this is also what my late Lola wants.\r\nYes, my lola joined now with our Lord.'),
(184, '2021-11-15 00:00:50', '2021-11-15 00:00:50', '1112050895', 'uploads/stories/IMG_20211115_144517.jpg', 'My FIRST OFFICE VISIT.', 'This was really one of the Most memorable experinces in my life! \r\n\r\nYung ang lakas ng ulan tapos sugod talaga kami sa Baha. Parang it\'s a sign na BUBUHOS NG BLESSINGS! This is Just the start! '),
(186, '2021-11-15 00:12:07', '2021-11-15 00:12:07', '1112050895', 'uploads/stories/IMG_20211115_150339.jpg', 'My FIRST PAYCHECK.', 'I was really amazed when I saw this!\r\nGrabe lang! Yung feeling na yung iniinvest mo ay may bumalik agad sayo!\r\nMeron ka ng Health & Wellness products, foods, tapos umincome ka pa.\r\n\r\nOh diba!! Sobrang nakaka excite at motivate talaga \'tong business na \'to.'),
(187, '2021-11-15 00:15:29', '2021-11-15 00:15:29', '1112050895', 'uploads/stories/received_927008678249951.jpeg', 'USING my Referral code, UMINCOME uli ako.', 'Yes! It\'s true! Eto yung maganda dito. You can also have your 3% commissions in every successful bookings basta gamit mo yung code mo when you placed booking. Oh diba, wala nito sa iba. Sa toktok lang talaga!'),
(188, '2021-11-15 00:18:24', '2021-11-15 00:18:24', '1112050895', 'uploads/stories/received_870704030299380.jpeg', 'More TRAININGS, Never STOP LEARNING.', 'This was the first time na nakasama ko ang 2 kong coach dito sa business na \'to, while attending our training rin. Kung gaya sa School, para mas matuto ka e kailangn mong pumasok palagi, dapat dito rin! Willing to train and learn ka palagi, kahit pa paulit-ulit pa yan. YES COACH ka dapat palagi!'),
(189, '2021-11-15 00:25:08', '2021-11-15 00:25:08', '1112050895', 'uploads/stories/png_20211115_151935_0000.png', 'My FIRST FOODHUB VISIT (BC Calamba).', 'Exciting part, yung nabusog ka na, Kumita ka pa, Bumili ka na, Nagka points ka pa.\r\n\r\nSino ba naman ang Hindi kikiligin kapag ganung kaganda ang Business mo? Yahooo!\r\n\r\nTalagang andaming opportunities, Hindi ka pababayaan, Taalagang tutulungan ka lalo sa panahon ngayon ng pandemya!'),
(190, '2021-11-15 00:33:27', '2021-11-15 00:33:27', '1112050895', 'uploads/stories/png_20211115_152343_0000.png', 'I became a TOP PERFORMER.', 'Since bago pa lang ako sa business na to,I wasn\'t expecting na makakakuha ako ng gantong award. But Look! God is really good. When you work hard for it, the Lord will really give it to you.\r\nI am really amazed & thankful to God for this. Sobrang thankful rin ak sa Coaches ko & sa buong The Champions!'),
(191, '2021-11-15 00:43:00', '2021-11-15 00:43:00', '1112050895', 'uploads/stories/received_248645540502703.jpeg', 'Continue on POSTING.. POST lang ng POST!', 'Wala man pumansin ng post mo, Wag kang susuko!\r\nSabi nga nila kung ang JOLLIBEE nga ang yaman na, promote pa ng promote. Ikaw pa ba na bago pa lang? Symepre dapat Mag promote rin tayo. \r\nMake use of our Products para ikaw mismo testimony rin kung gaano kalidad ang mga \'to!'),
(192, '2021-11-16 11:52:01', '2021-11-16 11:52:01', 'PPS11026442', 'uploads/stories/mercury.jpeg', 'My first transaction using Toktok delivery service', 'Very helpful and accommodating service.'),
(193, '2021-11-16 11:53:40', '2021-11-16 11:53:40', 'PPS11026442', 'uploads/stories/successful delivery.jpeg', 'First order for my customer!', 'Thank you to our poging toktok rider!'),
(194, '2021-11-16 11:55:07', '2021-11-16 11:55:07', 'PPS11026442', 'uploads/stories/champion.png', 'Training with group of franchisees', 'Learn before you earn.'),
(195, '2021-11-16 11:58:46', '2021-11-16 11:58:46', 'PPS11026442', 'uploads/stories/goalsetting.jpg', 'Goal Setting with our grand mentor', 'Knowledge, wisdom and strength.'),
(196, '2021-11-17 10:29:24', '2021-11-17 10:29:24', 'PPS7018421', 'uploads/stories/IMG_20211117_140627_edit_17849709683734.jpg', 'Delivery food products', '... '),
(197, '2021-11-17 10:54:54', '2021-11-17 10:54:54', '00428428', 'uploads/stories/256642583_676860866622635_2944592094116582836_n.png', 'How I want my future to be', 'My worth and value is not measured by employment, my dreams are way greater that only my business can provide that.'),
(198, '2021-11-17 21:48:35', '2021-11-17 21:48:35', '00593019', 'uploads/stories/710B2E68-F800-48C8-8ED6-6F05A847B1BD.jpeg', 'My Intenational China Travel With Our Bosses', 'already expected that something would happen this to you.'),
(200, '2021-11-17 22:06:47', '2021-11-17 22:06:47', '00593019', 'uploads/stories/254890CA-3A43-4AD5-8693-971DA90E6CD8.png', 'Leaders of my group The Champion', 'Since our business grows everyday, everyday I have trainings to to all of my franchisee and leaders of my team.'),
(201, '2021-11-17 22:11:03', '2021-11-17 22:11:03', '00593019', 'uploads/stories/BCF5DC24-8500-42D3-9A9A-B2AC75C7AB89.jpeg', 'Even more seafearers love this business', 'More and more wants to be part of this growing business'),
(202, '2021-11-17 22:13:53', '2021-11-17 22:13:53', '00593019', 'uploads/stories/997CC490-8951-4648-BEC0-07C5AFC018C0.jpeg', 'My Team The Champion Core Leaders', 'Bonding with my Leaders'),
(203, '2021-11-17 22:19:11', '2021-11-17 22:19:11', '00593019', 'uploads/stories/2E9FE8AB-8540-4B81-8880-053A52D76EBE.jpeg', 'Fruit of my Labor', 'For I know the plans I for you, plans to bring you prosperity and not disaster, during pandemic, we built this house. To God be the Glory...'),
(204, '2021-11-17 22:25:27', '2021-11-17 22:25:27', '00593019', 'uploads/stories/289DDA6D-088A-4E53-AA33-FD4DA6B9757A.jpeg', 'Toktok car incentive', 'Even car incentive we have a program in our company'),
(205, '2021-11-17 22:31:19', '2021-11-17 22:31:19', '00593019', 'uploads/stories/916816CE-3F43-42A3-B652-DB3B6A2BC35C.jpeg', 'One of my powerful leader', 'If this will happened to them, this will be happened to you and I am willing to guide you to grow your business.'),
(206, '2021-11-18 00:51:54', '2021-11-18 00:51:54', 'PPS18503057', 'uploads/stories/10.png', 'OUR FREE ONLINE TRAINING', 'WITH OUR MENTORS & BUSINESS PARTNERS'),
(207, '2021-11-18 06:21:50', '2021-11-18 06:21:50', '1111191616', 'uploads/stories/252224051_4457312451004270_2783531024815885951_n.jpg', 'Where it all started', 'I just got finished my schooling and it is hard to find job during this pandemic. I think about food business franchising and I found this toktok online franchising.'),
(213, '2021-11-18 10:32:33', '2021-11-18 10:32:33', '00593019', 'uploads/stories/648B54E6-3E9F-47F7-A2A7-B5CF7E5B5B21.jpeg', 'Boss Carl in Singapore', 'Boss Carl with us in singapore meeting to our leaders.'),
(214, '2021-11-18 10:35:37', '2021-11-18 10:35:37', '00593019', 'uploads/stories/7A6D1658-6894-4C7C-AF4C-91D7E34D5A84.jpeg', 'Father and Daughter Tandem', 'We are the founder of The Champion...'),
(215, '2021-11-18 10:39:07', '2021-11-18 10:39:07', '00593019', 'uploads/stories/E11407D4-43AF-4812-994F-A274DD3ECECA.jpeg', 'One of my powerful toktok leader, Lila Topacio', 'Yes we will support you all the way'),
(216, '2021-11-18 11:30:53', '2021-11-18 11:30:53', '1111191616', 'uploads/stories/Screenshot (190).png', 'My 1st Webinar', 'The 1st webinar that I attended that caught my interest and made me decide to franchise.'),
(217, '2021-11-18 11:32:15', '2021-11-18 11:32:15', '1111191616', 'uploads/stories/Remini20211118222716640.jpg', 'Officially Toktok Online Franchisee!', 'The day that I decided to franchise and never regretted it!'),
