(249, '2021-11-24 06:25:11', '2021-11-24 06:25:11', '1111351721', 'uploads/stories/Untitled design (2).png', 'How Did I Start in Toktok?', 'January 2021, I was about to go back to my previous job in Makati. But due to the pandemic, I postponed my plan and decided to search for a good business that could help me to generate income while at home. Then I discovered this Toktok online franchising.'),
(250, '2021-11-24 08:04:55', '2021-11-24 08:04:55', '1111351721', 'uploads/stories/20210419_200541_0003.png', 'It\'s Official!', 'It has been hard for me to decide (a career woman shifts to a businesswoman, yay), but I did! No regrets! I’m officially a Toktok Online Franchisee.'),
(251, '2021-11-24 08:46:38', '2021-11-24 08:46:38', '1111351721', 'uploads/stories/photo_2021-11-24_23-20-01.jpg', 'Training Is The Key!', 'What I love about this business is that our great mentors, leaders, and co-franchisees guide each of us by providing free training and coaching programs. We learned not only how to run the business, but they also taught us how to build up ourselves, the right attitude to become successful.'),
(252, '2021-11-24 09:22:29', '2021-11-24 09:22:29', '1111351721', 'uploads/stories/photo_2021-11-24_23-59-19.jpg', 'My First Income!', 'When I say training is the key, believe it! After one straight week of training and applying it as well, I earned it. Hard work, full of dedication, and willingness to learn pay-off! Being a good follower and listener (to your mentors and leaders) also helps to get results.'),
(253, '2021-11-24 09:34:46', '2021-11-24 09:34:46', '1111351721', 'uploads/stories/Untitled design.png', 'Our Franchisees Who Believe In This Business', 'We all knew that this pandemic was really a hard time for us. But because of the potential of our franchise business, some of our friends, relatives, and even our customers joined us and became our business partners.'),
