(307, '2022-01-26 06:48:40', '2022-01-26 06:48:40', '1111499730', 'uploads/stories/IMG20220121162359.jpg', 'Kpads', 'My first costumer Ng kpads :)'),
(308, '2022-02-10 19:13:06', '2022-02-10 19:13:06', '1112050895', 'uploads/stories/received_520789312654321.jpeg', 'It\'s really a \"WELCOME TO THE GOOD LIFE!\"', 'They say \"To see is to believe\". But I\'m glad, I believed first and now I can see how amazing this business has in store for me. This doesn\'t just support my everyday living but it also help me and my family have a healthy lifestyle! I am not just a franchisee, I am a proud user of these products!'),
(309, '2022-02-10 19:39:46', '2022-02-10 19:39:46', '1112050895', 'uploads/stories/received_702762710877994.jpeg', 'Enjoy the nature of your business!', 'In here, we don\'t just sell the products, we share the Quality of our products, How can it be beneficial to your health. Remember, We care about your health & wellness.\r\nWe satisfy your cravings with our Food products (SiomaiKing, Siopao the King, MangsBoks,BoyBondat & more) at an affordable price!'),
(310, '2022-02-10 21:19:29', '2022-02-10 21:19:29', '1112050895', 'uploads/stories/received_1299297333830225.jpeg', 'TOKTOK Delivery Sevice.', 'Toktok has really helped me a lot. Aside from the income that I can get from my other businesses, with just using my toktok app, I can have an easy and hassle free delivery service in just a few clicks. In addition to that, I\'m also earning in every successful delivery transaction. ????'),
(311, '2022-03-04 18:43:35', '2022-03-04 18:43:35', '1112050895', 'uploads/stories/IMG_20220305_093900.jpg', 'SIOMAI KING SULIT PACK!!!', 'OMG! I\'m super happy & proud to tell you guys that I started and believed in this business! They even launched Community Franchise that will really help people in the community. As a franchisee, I can now distribute Sulit packs in our community!! Talagang sulit na sulit! SIOMAI KING YAN yeey!');
